    July 1 - Dec. 31, 2007, Please amend Schedule B supporting Line 23 by providing
    the address, candidate name, office sought, state, district for each contribution
    made.  11 CFR 104.3(b)(3)(ii) and (v) I spoke with my campaign analyst who suggested
