    support.   Tech support  requested I email the report in question to her, and
    after checking the report, advised that the information requested cannot be amended
    due to a glich in the software.  The tech support person is also unable to amend
    the report.  I then contacted my campaign analyst and advised him of the outcome
    of my conversation with tech support.  The campaign analyst advised that I send
    this memo to advise why the report was not amended, and cannot be amended by either
    myself or technical support.                                Barbara Riegner "
